import React, {useState} from "react";

interface IProps {}
interface IState {
    eating : boolean;
    coding : boolean;
    sleeping : boolean;
}

let HobbySelector:React.FC<IProps> =() =>{
    let [hobbySelectorState,SetHobbySelectorState]= useState({
        eating : false,
        coding : false,
        sleeping : false
    });
    return(
        <React.Fragment>
            <h2> HobbySelector Components</h2>

        </React.Fragment>
    )
};
export default HobbySelector;
